import React from "react";

import { Menu, Layout } from 'antd';

const { Header} = Layout;

const HeaderMovies = () =>  {
    return (
        <Header>
            <div className="logo" />
                <Menu theme="dark" mode="horizontal" defaultSelectedKeys={['2']}>
                    <Menu.Item key='/popular-movies'>Popular movies</Menu.Item>
                    <Menu.Item key='/upcoming-movies'>Upcoming movies</Menu.Item>
                    <Menu.Item key='/search-movies'>Search movies</Menu.Item>
                    <Menu.Item key='/favorite-movies'>Favorite movies</Menu.Item>
                </Menu>
        </Header>
    )
}
export default React.memo();
